  `min_age_guests` varchar(2) COLLATE utf8_persian_ci NOT NULL COMMENT 'حداقل سن میهمان',
  `max_age_guests` varchar(2) COLLATE utf8_persian_ci NOT NULL COMMENT 'حداکثر سن میهمان',
