  `long_days_run` int(2) unsigned NOT NULL COMMENT 'مدت مراسم',
  `start_time_run` varchar(20) COLLATE utf8_persian_ci NOT NULL COMMENT 'ساعت شروع',
  `end_time_run` varchar(20) COLLATE utf8_persian_ci NOT NULL COMMENT 'ساعت پایان',
  `max_more_days` int(2) unsigned DEFAULT NULL,
  `more_days` int(2) unsigned DEFAULT NULL COMMENT 'تعداد روزهای اضافه تر از پیشفرض',
  `state_id` int(10) unsigned NOT NULL COMMENT 'استان',
  `city_id` int(10) unsigned NOT NULL COMMENT 'شهرستان',
  `town` varchar(25) COLLATE utf8_persian_ci DEFAULT NULL COMMENT 'شهرک',
  `main_street` varchar(25) COLLATE utf8_persian_ci DEFAULT NULL COMMENT 'خیابان اصلی',
  `by_street` varchar(25) COLLATE utf8_persian_ci DEFAULT NULL COMMENT 'خیابان فرعی',
  `boulevard` varchar(25) COLLATE utf8_persian_ci DEFAULT NULL COMMENT 'بلوار',
  `afew_ways` varchar(25) COLLATE utf8_persian_ci DEFAULT NULL COMMENT 'سه یا چهارراه',
  `squary` varchar(25) COLLATE utf8_persian_ci DEFAULT NULL COMMENT 'میدان',
  `bridge` varchar(25) COLLATE utf8_persian_ci DEFAULT NULL COMMENT 'پل/زیر گذر',
  `quarter` varchar(25) COLLATE utf8_persian_ci DEFAULT NULL COMMENT 'محله',
  `area_code` int(2) unsigned DEFAULT NULL COMMENT 'منطقه شهرداری',
  `postal_code` varchar(10) COLLATE utf8_persian_ci DEFAULT NULL COMMENT 'کد پستی',
  `complete_address` text COLLATE utf8_persian_ci NOT NULL COMMENT 'آدرس',
  `complete_details` text COLLATE utf8_persian_ci COMMENT 'توضیحات تکمیلی',
  `reception` varchar(256) COLLATE utf8_persian_ci DEFAULT NULL COMMENT 'پذیرایی',
  `invitees` text COLLATE utf8_persian_ci COMMENT 'مدعوین',
  `activator_area_code` tinyint(1) unsigned DEFAULT '0' COMMENT 'فعال شدن منطقه شهرداری',
  `activator_postal_code` tinyint(1) unsigned DEFAULT '0' COMMENT 'فعال شدن کدپستی',
  `ceremony_poster` varchar(256) CHARACTER SET latin1 DEFAULT NULL COMMENT 'پوستر مراسم',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 COLLATE=utf8_persian_ci;

