INSERT INTO `iw_pages` VALUES ('1', 'درباره', '<p>سایت گهر از سال 1390 در حوضه ارسال پیام فعالیت داشته است.</p>\r\n\r\n<p>ابتدای امر با اخذ نمایندگی از سایت ها و شرکت های معتبر شروع کرده ایم و در حال حاضر مستقلا فعالیت مینماییم و ان شا الله روز به روز موجب جلب رضایت بیشتر شما خواهیم شد</p>\r\n\r\n<p>برنامه اینده ما تولید اپلیکیشن اندرودی سایت و امکان ثبت نمایندگی است.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" src=\"http://gohar.org/tarsim/images/Gohar-logo.png\" style=\"height:329px; width:313px\" /></p>\r\n', 'about');
INSERT INTO `iw_pages` VALUES ('2', 'ارتباط با ما', '<p><strong><span style=\"font-size:14px\">&nbsp;تلفن : 025 &nbsp; 37718029 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></strong><strong><span style=\"font-size:14px\">ایمیل :&nbsp;<img alt=\"\" src=\"http://gohar.org/tarsim/images/gohar-gmail.png\" style=\"height:41px; width:190px\" /></span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:14px\">آدرس : قم - خ باجک (19دی) - ک25 - پ30 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img alt=\"\" src=\"http://gohar.org/tarsim/images/gohar-location.png\" style=\"height:133px; width:199px\" /></span></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'contact');
INSERT INTO `iw_pages` VALUES ('3', 'لیست امکانات مشترک پنل ها', '<p>تست</p>\r\n', 'plans_options_list');
INSERT INTO `iw_pages` VALUES ('4', 'صفحه اصلی', '<p style=\"text-align:justify\"><span style=\"font-size:14px\"><strong>با ثبتنام در سایت گهر و پرداخت ماهانه 100000 هزار تومان ، میتوانید ، ماهانه 500 ایمیل ارسال نمایید</strong></span></p>\r\n\r\n<p style=\"text-align:justify\">یکی از اشکال بازاریابی الکترونیکی بازاریابی با ایمیل یا ایمیل مارکتینگ است .&nbsp; ارسال یک ایمیل به چندین میلیون نفر در سرتاسر کشوری جهت معرفی محصولات و یا خدمات شرکت و یا معرفی وب سابت خود وتشویق مشتری جهت بازدید از آن مانند ارسال یک نامه فروش ، یک روزنامه ، یک پیام پشتیبانی یا حتی یک سؤال قسمتی از بازاریابی با ایمیل می باشد ، ارتباط با مشتری از طریق ایمیل یکی از روشهای معرفی محصول و یا خدمات به مردم است .<br />\r\n<span style=\"color:rgb(255, 0, 0)\">بازاربابی با ایمیل یک ابزار فروش کارآمد</span><br />\r\nدر این روش بازاریابی الکترونیکی فروشنده به جای اینکه منتظر بماند تا مشتری محصول و خدمات شرکت را به صورت آنلاین جستجو نماید یک پیغام معرفی خدمات را برای آنها ارسال میکند در واقع خود زمان و محتوای پیغام را تعیین میکند . همچنین ایمیل یک ابزار عالی برای تعقیب یک نامه مستقیم یا عملیات بازاریابی از راه دور(Telemarketing)است و درنتیجه سرعت پاسخگوئی و بازگشت سرمایه فروش را افزایش میدهد. . به عنوان مثال می توانید در یک فاصله زمانی کم با ارسال یک ایمیل ، ایمیل ارسال شده را بعد پیگیری کنید. یا می توانید آدرس ایمیل آنها را برای فرستادن اطلاعات اضافی و یا اضافه کردن آنها به یک پاسخ دهنده اتوماتیک درخواست کنید.</p>\r\n\r\n<p style=\"text-align:justify\">معرفی محصولات وخدمات بتنهایی با ارسال یک ایمیل به میلیونها نفر در سطح کشور روشی هدفمند و از لحاظ اقتصادی مناسب ترین روش تبلیغات در سطح شبکه جهانی اینترنت است . همچنین می&zwnj;توان با توجه به نوع محصولات و یا خدمات ، گروهی ازکاربران را جهت معرفی محصول انتخاب کرد .<br />\r\n<span style=\"color:rgb(255, 0, 0)\">مزاياي تبليغات اینترنتی نسبت به تبليغات سنتي</span><br />\r\n1.&nbsp;&nbsp; &nbsp;سرعت ،&nbsp; تبليغات آنلاين سريع بدست هدف مورد نظر مي رسد .<br />\r\n2.&nbsp;&nbsp; &nbsp;اطمينان ، تبليغات آنلاین کاملاً تحت کنترل بوده و می&zwnj;توان از سيدن تبليغ بدست هدف مطمئن بود ولی در روش سنتي ارسال تبلیغات همواره با شک و تردید همراه خواهد بود .&nbsp;<br />\r\n3.&nbsp;&nbsp; &nbsp;كارائي بالاتر ، تبلیغات و بازاریابی الکترونیکی به دلیل جذابیت و تازگی نسبت به نوع سنتی آن مانند پست مستقیم و یا تبلیغات عمومی در روزنامه و یا مجله بیشتر سبب جذب بیشتر مشتری می &zwnj;شود .&nbsp;<br />\r\n4.&nbsp;&nbsp; &nbsp;ارتباط دو طرفه ،&nbsp; در تبليغات آنلاین یک تعامل دو طرفه میان تولید کننده و مشتری وجو دارد .&nbsp;<br />\r\n5.&nbsp;&nbsp; &nbsp; ارزانتر بودن ، این نوع تبليغات با کمک تکنولوژی نیازی به استفاده از مواد فيزيكي مانند كاغذ و جوهر و سيستمهاي حمل و نقل مانند پست ندارد بنابراین ارزانتر و به صرفه تر از تبلیغات سنتی است .</p>\r\n\r\n<p style=\"text-align:justify\">6.&nbsp;&nbsp; &nbsp;گروه مخاطبان ، گروه مخاطبان در این نوع تبلیغ همواره از طبقه متوسط و مرفه جامعه از جمله قشر تحصيل كرده و گروه مديران و راهبران با قدرت خريد بالاتر مي باشند .</p>\r\n\r\n<p style=\"text-align:justify\">از دیگر مزایای بازاریابی با ایمیل می&zwnj;توان به این موارد اشاره کرد : طراحي ايميل با طرحی زیبا متناسب با محصول و سلیقه شما با زمينه رنگي گرافيك مناسب و قيمت فوق العاده پايين نسبت به ديگر روشهاي تبليغات اين امكان را به شما می&zwnj;دهد تا تعداد افرادي را كه ايميل دريافتي را باز كرده اند و خوانده اند را مشاهده نماييد و در صورت داشتن سايت اينترنتي و معرفي آن در ايميل آمار تعداد كساني كه از طريق ايميل به سايت اينترنتي شما مراجعه كرده اند را داشته باشيد.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><img alt=\"\" src=\"http://gohar.org/tarsim/images/all-bank-logo.jpg\" style=\"height:135px; width:160px\" />&nbsp; &nbsp;<img alt=\"\" src=\"http://gohar.org/tarsim/images/behpardakhte-logo.png\" />&nbsp; &nbsp;<img alt=\"\" src=\"http://gohar.org/tarsim/images/behpardakhteMelat.png\" />&nbsp; &nbsp;<img alt=\"\" src=\"http://gohar.org/tarsim/images/ghavamin-icon-90x90.png\" />&nbsp; &nbsp;</p>\r\n', 'home');
